<p>JR東の新幹線は小さい頃からよく乗っていたが， 目的地が盛岡，山形，長野であることが多かったので， 実はE4系とはあまり縁がない．</p>
<p>周りを見ると新潟周辺の人々は思い入れが強そうだ．</p>
<p>定期運行からは引退したが，今日と明日に新潟―盛岡間を 臨時列車として運行している．今後も旅行パッケージの企画などで臨時運用されるのだろうか．</p>
<p>仙台まで来る機会があれば，家から見てみたい．</p>
